
CREATE DATABASE ssd_sample_database1;
GO
USE ssd_sample_database1


CREATE TABLE pt_deid (
    pt_id INT,
    dob DATETIME,
    over_90 SMALLINT,
    race_1 VARCHAR(50)
);


CREATE TABLE  diagnosis_deid (
    diagnosis_id INT,
    pt_id INT,
    diagnosis_code VARCHAR(50) ,
    diagnosis_code_set VARCHAR(50) ,
    diagnosis_start_dt DATETIME,
    diagnosis_end_dt DATETIME,
    diagnosis_name VARCHAR(120)
);


CREATE TABLE  lab_value_deid (
    lab_value_id INT,
    pt_id INT,
    name VARCHAR(50) ,
    loinc_code VARCHAR(50) ,
    value VARCHAR(50) ,
    value_numeric DECIMAL(18, 0),
    reference_high VARCHAR(50) ,
    reference_low VARCHAR(50) ,
    reference_normal VARCHAR(50) ,
    reference_unit VARCHAR(50) ,
    result_category VARCHAR(50) ,
    order_dt DATETIME,
    result_dt DATETIME
);


CREATE TABLE  medication_deid (
    medication_id INT,
    pt_id INT,
    generic_name VARCHAR(70) ,
    therapeutic_class VARCHAR(70) ,
    order_placed_dt DATETIME,
    order_end_dt DATETIME,
    usage_directions VARCHAR(100) ,
    order_class VARCHAR(50) ,
    strength VARCHAR(50) ,
    form VARCHAR(50) ,
    number_of_doses INT,
    dose_unit VARCHAR(50) ,
    frequency VARCHAR(50)
);


CREATE TABLE  medication_administration_deid (
    medication_administration_id INT,
    pt_id INT,
    generic_name VARCHAR(70) ,
    therapeutic_class VARCHAR(50) ,
    order_placed_dt DATETIME,
    order_end_dt DATETIME,
    scheduled_administration_dt DATETIME,
    administration_dt DATETIME,
    discontinue_order_dt DATETIME,
    action_name VARCHAR(50) ,
    medication_id INT
);


CREATE TABLE  smart_data_deid (
    smart_data_id INT,
    pt_id INT,
    element_name VARCHAR(150) ,
    smrtdta_elem_value VARCHAR(200) ,
    elem_nw_id_val_num INT,
    value_dt DATETIME
);
